import React from 'react';
import './Climb.css';
import carabiner from './carabiner-logo.svg';
import userLogo from './user-logo.svg';


const Climb = ({climbList}) => {

    return climbList.map((climb, index) => (
      <div className='climb-container'> 
        <div className='climb-data-container'>
          <img src={userLogo} className='user-logo' alt='user logo'/>

          <div>
            <div className='climb-data-heading'>
              {climb.username}
            </div>
            <div className='climb-data-container'>
              <div className='climb-data'>
                {climb.date}
              </div>
              <img src={carabiner} className='carabiner' alt='carabiner'/>
              <div className='climb-data'>
                {climb.gym}
              </div>
            </div>

          </div>

        </div>
        <div className='climb-data-container'>
          <div className='climb-data'>
              {climb.climbType}
          </div>
          <div className='climb-data-heading'>
            {climb.climbName}
          </div>
        </div>

        <div className='climb-data-container'>
          <div className='climb-data'>
            {climb.grade}
          </div>
          <div className='climb-data'>
            {climb.rating}
          </div>
        </div>




      </div>

      ));



};

export default Climb;
